description:
These are LuaJIT 2.0.1 binaries for Windows.

The binaries have been built from LuaJIT git HEAD (commit d686217 on May 24, 2013 at 01:28:40 GMT+0200) with /DLUAJIT_ENABLE_LUA52COMPAT option (see http://luajit.org/extensions.html#lua52).

